import React from 'react';
import data from "./data.svg";
import settings from "./settings.svg";


const Icon = () => {
    return (
        <div>
        <span><img src={data} className="Icon-db" alt="data"/></span>
        <span><img src={settings} className="Icon-st" alt="settings"/></span>        
        </div>
    )
}

export default Icon;
